import './Header.sass';
import '../../../icons/logo.svg'
import logo from '../../../icons/logo.svg';
import sun from '../../../icons/light_theme_icon.svg';
import moon from '../../../icons/dark_theme_icon.svg';

const Header = () => {
    return(
        <header>
            <div className="wrapper">
                <img src={logo} className="logo" alt='logo'/>
                <div className="switcher">
                    <img src={moon} className="logo" alt='moon'/>
                    <img src={sun} className="logo" alt='sun'/>
                    <div className="switcher__item"></div>
                </div>
            </div>
           
            <nav>
            </nav>
        </header>    
    )
}

export default Header;
